/* Function  structure for function  `p_get_next_stt` */

/*!50003 DROP FUNCTION IF EXISTS `p_get_next_stt` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `p_get_next_stt`(_btn_id INT(3)) RETURNS int(11)
    DETERMINISTIC
BEGIN
	DECLARE v_stt INT(11) DEFAULT null;
	SELECT stt INTO v_stt FROM stt_tiepnhan WHERE ngay = CURDATE()  AND btn_id = _btn_id limit 1;
	if v_stt is null then
		set v_stt := 1;
		insert into stt_tiepnhan (stt,ngay,btn_id) values (2,CURDATE(),_btn_id);
	else
		update stt_tiepnhan set stt=stt+1 where ngay = CURDATE() AND btn_id = _btn_id;	
	end if;
	RETURN v_stt;	
    END */$$
DELIMITER ;

