	SELECT stt INTO v_stt FROM stt_tiepnhan WHERE ngay = CURDATE()  AND btn_id = _btn_id LIMIT 1;
	IF v_stt IS NULL THEN
		SET v_stt := 1;
		INSERT INTO stt_tiepnhan (stt,ngay,btn_id) VALUES (2,CURDATE(),_btn_id);
	ELSE
		UPDATE stt_tiepnhan SET stt=stt+1 WHERE ngay = CURDATE() AND btn_id = _btn_id;	
	END IF;
	RETURN v_stt;
    END */$$
