BEGIN            
        DECLARE _stt INT(100);
        DECLARE v_kq INT(100);
        DECLARE v_ketqua INT(100);
        DECLARE v_kiemtra INT(100);
        SELECT COUNT(*) INTO v_kiemtra 
        FROM tiepnhan  t
        WHERE btn_id=_btn_id AND user_bat_online=_user_bat_online AND DATE(t.ngay_tn) = CURDATE();
        IF (v_kiemtra = 0) THEN 
		SET _stt = p_get_next_stt(_btn_id);
		INSERT INTO tiepnhan (ngay_tn,btn_id,stt,bat_online,user_bat_online) 
			   VALUES (NOW(),_btn_id,_stt,1,_user_bat_online);
		SELECT _stt AS ketqua,'TRUE' AS kiemtra,_btn_id AS quay;
	 ELSE  
	        SELECT MAX(stt) AS ketqua,'FALSE' AS kiemtra,_btn_id AS quay
		FROM tiepnhan  t
		WHERE btn_id=_btn_id AND user_bat_online=_user_bat_online AND DATE(t.ngay_tn) = CURDATE();
	 END IF;
END */$$
