/* Procedure structure for procedure `p_get_thongbaodonvi` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_get_thongbaodonvi` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_get_thongbaodonvi`(
	p_madonvi varchar(100),
	p_type varchar(500)
)
BEGIN
	declare v_thongbao varchar(4069) default null;
	DECLARE v_thongbao_cap0 varchar(2048) default null;
	DECLARE v_thongbao_cap1 varchar(2048) default null;
	DECLARE v_chucmungsinhnhat VARCHAR(2048) DEFAULT NULL;
	
	DECLARE v_kt_thongbao_cap0 int(11) DEFAULT 0;
	DECLARE v_kt_thongbao_cap1 INT(11) DEFAULT 0;
	DECLARE v_kt_sinhnhat INT(11) DEFAULT 0;
	
	select count(*) into v_kt_thongbao_cap0 FROM ql_thongbao WHERE donvi_ma = p_madonvi AND tb_cap = 0 AND tb_trangthai = 1 AND NOW() BETWEEN tb_tungay AND tb_denngay;
	select group_concat(tb_noidung separator ', ') into v_thongbao_cap0 from ql_thongbao where donvi_ma = p_madonvi and tb_cap = 0 and tb_trangthai = 1 and NOW() between tb_tungay and tb_denngay;
	
	SELECT COUNT(*) INTO v_kt_thongbao_cap1 FROM ql_thongbao WHERE donvi_ma = p_madonvi AND tb_cap = 1 AND tb_trangthai = 1 AND NOW() BETWEEN tb_tungay AND tb_denngay;
	SELECT GROUP_CONCAT(tb_noidung SEPARATOR ', ') INTO v_thongbao_cap1 FROM ql_thongbao WHERE donvi_ma = p_madonvi AND tb_cap = 1 AND tb_trangthai = 1 AND NOW() BETWEEN tb_tungay AND tb_denngay;
	
	select count(*) into v_kt_sinhnhat from ql_dm_nhanvien where DATE_FORMAT(nv_ngaysinh,'%d') = DATE_FORMAT(CURRENT_DATE(),'%d') and DATE_FORMAT(nv_ngaysinh,'%m') = DATE_FORMAT(CURRENT_DATE(),'%m');
	if v_kt_sinhnhat > 0 then
		select  GROUP_CONCAT(concat('Chúc mừng sinh nhật nhân viên: ',nv_hoten,' (',date_format(nv_ngaysinh,'%d/%m/%Y'),')') SEPARATOR '; ') INTO v_chucmungsinhnhat FROM ql_dm_nhanvien WHERE DATE_FORMAT(nv_ngaysinh,'%d') = DATE_FORMAT(CURRENT_DATE(),'%d') AND DATE_FORMAT(nv_ngaysinh,'%m') = DATE_FORMAT(CURRENT_DATE(),'%m');
	else
		SET v_chucmungsinhnhat = '';
	end if;
	
	if (v_kt_thongbao_cap0 > 0 and v_kt_thongbao_cap1 = 0) then
		set v_thongbao = concat('THÔNG BÁO: ',IFNULL(v_thongbao_cap0,' '));
	elseif (v_kt_thongbao_cap0 = 0 AND v_kt_thongbao_cap1 > 0) then
		SET v_thongbao = CONCAT('THÔNG BÁO: ',IFNULL(v_thongbao_cap1,' '));
	elseif (v_kt_thongbao_cap0 > 0 AND v_kt_thongbao_cap1 > 0) then
		SET v_thongbao = CONCAT('THÔNG BÁO 1: ',ifnull(v_thongbao_cap0,' '),'; THÔNG BÁO 2: ',ifnull(v_thongbao_cap1,' '));
	else
		set v_thongbao = '';
	end if;
	
	if v_kt_sinhnhat > 0 then
		select concat(IFNULL(v_chucmungsinhnhat,' '),' - ',ifnull(v_thongbao,' ')) as thongbao from dual;
	else
		SELECT IFNULL(v_thongbao,' ') AS thongbao FROM DUAL;
	end if;
    END */$$
DELIMITER ;

