/* Procedure structure for procedure `p_loadthongtinsoquay` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_loadthongtinsoquay` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_loadthongtinsoquay`(IN `p_madonvi` VARCHAR(100))
SELECT tt.key_cauhinh ,tt.value_cauhinh, tt.ten_quay,tt.sohientai, tt.noidung,MIN(tt.stt) AS stt FROM (
			SELECT aa.key_cauhinh AS key_cauhinh , aa.value_cauhinh AS value_cauhinh, aa.ten_quay AS  ten_quay, IFNULL(tn.sohientai,0) AS sohientai, aa.noidung AS noidung, IFNULL(tn.stt,0) AS stt
			FROM 
			  (SELECT  ch.key_cauhinh AS key_cauhinh ,ch.value AS value_cauhinh, b.ten_quay AS ten_quay ,"Giao dịch hiện tại số: " AS noidung
			   FROM cau_hinh ch 
				LEFT JOIN  quay b ON ch.id_quay= b.id_quay
			    WHERE ch.id_quay IS NOT NULL
			    ORDER BY ch.id_quay ASC
			    ) aa 
			  LEFT JOIN 
			(			
			SELECT t.btn_id,CASE WHEN t.stt=1 THEN 0 ELSE (MIN(t.stt)-1) END  AS stt  ,(MAX(xx.stt)-1) AS sohientai
			FROM tiepnhan t 
			    LEFT JOIN stt_tiepnhan xx  ON t.btn_id = xx.btn_id
			WHERE  t.trang_thai = 0 AND DATE(t.ngay_tn) =CURDATE()  AND DATE(xx.ngay) = CURDATE() 				
			GROUP BY t.btn_id,t.stt
			ORDER BY t.btn_id ASC
			) tn ON aa.key_cauhinh= tn.btn_id) tt GROUP BY 
            tt.key_cauhinh ,tt.value_cauhinh, tt.ten_quay,tt.sohientai, tt.noidung
            ORDER BY tt.key_cauhinh */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_ct_sanpham` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_load_ct_sanpham` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_ct_sanpham`(
	p_idban varchar(500),
	p_madatban varchar(100),
	p_trangthai varchar(100),
	p_madonvi varchar(100)
)
BEGIN
	select nv.nv_hoten, dv.dv_ten, ct.dbct_id, ct.donvi_ma, ct.db_id, ct.dv_id, ct.dbct_soluong, ct.dbct_dongia, ct.dbct_thanhtien, ct.dbct_ngaylap, date_format(ct.dbct_ngaygiolap,'%d-%m-%Y %H:%i:%s') as dbct_ngaygiolap, ct.dbct_namlap, ct.nv_ma, ct.dbct_trangthai, ct.dbct_ghichu
	from ql_datban db, ql_datban_chitiet ct, ql_dm_dichvu dv, ql_dm_nhanvien nv
	where ct.donvi_ma = p_madonvi AND db.db_id = p_madatban
		and dv.donvi_ma = p_madonvi and dv.dv_id = ct.dv_id
		and db.donvi_ma = p_madonvi and db.db_id = ct.db_id
		and db.ban_id = p_idban and nv.nv_ma = ct.nv_ma
		and nv.donvi_ma = p_madonvi;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_dm_linhvuc` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_load_dm_linhvuc` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_dm_linhvuc`(
	p_madonvi VARCHAR(100),
	p_donvi_canbo VARCHAR(100)
)
BEGIN 
        DECLARE v_kq INT(11);
        
	SELECT id_linhvuc as id_linhvuc,ten_linhvuc as ten_linhvuc, true as selected
	FROM linh_vuc t
	WHERE tt_linhvuc=1 and donvi_quanli=p_madonvi and id_donvi=p_donvi_canbo
	ORDER BY id_linhvuc desc;
	
	SELECT ROW_COUNT() INTO v_kq;
	SELECT v_kq AS ketqua;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_dm_quay` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_load_dm_quay` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_dm_quay`(
	p_madonvi VARCHAR(100),
	p_madichvu VARCHAR(100),
	p_maloaidichvu VARCHAR(100)
)
BEGIN
	SELECT ct.id_ct_quay AS id_quay ,q.ten_quay 
	FROM ct_quay ct
	LEFT JOIN quay q ON ct.donvi = q.donvi AND ct.id_quay=q.id_quay
	WHERE  q.tt_quay=1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_dm_quay_theodv` */

