DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_dm_quay_theodv`(
	p_madonvi VARCHAR(100)
)
BEGIN
	SELECT  id_quay AS id_quay, ten_quay AS ten_quay
	FROM quay
	WHERE donvi=p_madonvi;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_dsketquaonline` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_load_dsketquaonline` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_dsketquaonline`(IN `p_makhachhang` VARCHAR(100))
SELECT  ch.key_cauhinh AS key_cauhinh ,ch.value_cauhinh AS ten_quay, b.ten_quay AS quay ,
        tn.user_bat_online AS ma_khachhang,'Trần Thiên Phú' AS ten_khachhang ,DATE_FORMAT(tn.ngay_tn,'%d/%m/%Y  %T')AS ngay_tn ,
        CASE WHEN tn.trang_thai=0 THEN 'Chưa giao dich' ELSE 'Đã giao dich' END AS trang_thai,tn.stt AS stt
			   FROM cau_hinh ch 
				LEFT JOIN  quay b ON ch.id_quay= b.id_quay
				LEFT JOIN tiepnhan tn ON ch.id_quay=tn.btn_id
			    WHERE tn.ngay_tn IS NOT NULL AND tn.user_bat_online= p_makhachhang
			    ORDER BY tn.ngay_tn DESC */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_dsnhanvien` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_load_dsnhanvien` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_dsnhanvien`(
	p_madonvi VARCHAR(100)
)
BEGIN
	SELECT id_canbo,hoten_canbo,dv.id_donvi as madonvi_canbo , dv.ten_donvi AS donvi_canbo,lv.id_linhvuc AS id_linhvuc,lv.ten_linhvuc AS linhvuc_canbo,DATE_FORMAT(ngaysinh_canbo,'%d/%m/%Y') as ngaysinh_canbo,
	CAST(img_canbo AS CHAR(90000) CHARACTER SET utf8) AS img_canbo,'Chọn sửa để cập nhật ảnh' as img_nhanvien,id_ct_quay,tt_canbo,cb.donvi_quanli as donvi_quanli
	FROM can_bo cb 
	LEFT JOIN don_vi dv ON cb.donvi_canbo= dv.id_donvi
	LEFT JOIN linh_vuc lv ON cb.linhvuc_canbo= lv.id_linhvuc
	where cb.da_xoa !=1;	
    END */$$
DELIMITER ;

