/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_ds_ban`(
	p_madonvi VARCHAR(100)
	)
BEGIN
	select  concat(dmban.ban_id,'.//.',dmban.ban_trangthai,'.//.',ifnull(db.db_id,'')) as keybanid, dmban.ban_trangthai, dmban.donvi_ma, dmban.ban_ten
	from ql_dm_ban dmban left join ql_datban db on db.donvi_ma = dmban.donvi_ma and db.donvi_ma = p_madonvi and db.ban_id = dmban.ban_id and db.db_trangthai_thanhtoan = 0
	where dmban.donvi_ma = p_madonvi and dmban.ban_trangthai > 0 order by dmban.ban_order, dmban.ban_id;
