/* Procedure structure for procedure `p_luu_danhgiaykien` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_luu_danhgiaykien` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_luu_danhgiaykien`(
                IN p_madonvi VARCHAR(500),
		IN p_id_quay VARCHAR(500),
                IN p_id_canbo VARCHAR(50),
                IN p_donvi_canbo VARCHAR(20),
                IN p_stt_vuagoi VARCHAR(20),
                IN p_btn_id VARCHAR(20),
                IN p_noidung VARCHAR(500)
                )
BEGIN
           DECLARE v_kq INT(100);
           
           DECLARE v_kiemtra INT(100);
           
           SELECT COUNT(*) INTO v_kiemtra   FROM danh_gia WHERE stt = p_stt_vuagoi AND date_danhgia=CURDATE() AND id_linhvuc = p_id_quay AND id_canbo=p_id_canbo;
           if (v_kiemtra =0) THEN  
		   INSERT INTO danh_gia (donvi_quanli,id_donvi,id_linhvuc,id_tieuchi,id_canbo,datetime_danhgia,noidung_danhgia,stt,date_danhgia) 
		   VALUES (p_madonvi,p_donvi_canbo,p_id_quay,p_btn_id,p_id_canbo,DATE_FORMAT(NOW(),'%Y-%m-%d %H:%i:%s'),p_noidung,p_stt_vuagoi,DATE_FORMAT(NOW(),'%Y-%m-%d'));
                   
                  --  SELECT ROW_COUNT() INTO v_kq;   
                  SET v_kq = 1;
           else     
                  SET v_kq = 2; 
           END IF;
	          SELECT v_kq AS ketqua;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `p_them_banmoi` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_them_banmoi` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_them_banmoi`(
	p_madonvi varchar(100),
	p_idban varchar(200),
	p_manhanvien varchar(100)
)
BEGIN
	declare v_ma_datban int(11) default 0;
	DECLARE v_kq INT(11) DEFAULT 0;
	
	insert into ql_datban(donvi_ma, ban_id, db_ngaylap, db_ngaygiolap, db_namlap, db_trangthai_thanhtoan, nv_ma, db_nhanvien_thanhtoan, db_nhanvien_huythanhtoan, db_nhanvien_huyban, db_ghichu, db_trangthai, db_mabanghep)
	values(p_madonvi, p_idban, date_format(CURRENT_DATE(),'%Y-%m-%d'), NOW(), DATE_FORMAT(CURRENT_DATE(),'%Y'), 0, p_manhanvien, '', '', '', '','1','');
	
	SELECT ROW_COUNT() INTO v_kq;
	if v_kq > 0 then
		update ql_dm_ban set ban_trangthai = 2 where p_idban = ban_id and donvi_ma = p_madonvi;
		select max(db_id) into v_ma_datban from ql_datban;
	else 
		set v_ma_datban = 0;
	end if;
	
	select v_ma_datban as madatban;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_them_nhanvien` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_them_nhanvien` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_them_nhanvien`(
                IN p_madonvi VARCHAR(500),
		IN p_dm_tennv VARCHAR(500),
                IN p_dm_ngaysinhnv VARCHAR(50),
                IN p_dm_iddonvi VARCHAR(20),
                IN p_dm_idlinhvuc VARCHAR(20),
                IN p_dm_idquay VARCHAR(20),
                IN p_img_canbo LONGTEXT)
BEGIN
	
           DECLARE v_kq INT(100);
           DECLARE v_id_canbo INT(10);
             SELECT MAX(id_canbo) INTO v_id_canbo FROM can_bo where donvi_quanli=p_madonvi;
		      IF (v_id_canbo IS NULL) THEN
				SET v_id_canbo = 0;
		      ELSE
				SET v_id_canbo = v_id_canbo+1;
		      END IF;
           INSERT INTO can_bo (donvi_canbo,linhvuc_canbo,id_canbo,ngaysinh_canbo,id_ct_quay,img_canbo,hoten_canbo,tt_canbo,donvi_quanli,da_xoa) 
                     VALUES ( p_dm_iddonvi,p_dm_idlinhvuc,v_id_canbo,DATE_FORMAT(p_dm_ngaysinhnv,'%Y-%m-%d'),p_dm_idquay,p_img_canbo,p_dm_tennv,'1',p_madonvi,'0');
                     
           SELECT ROW_COUNT() INTO v_kq;	
           
	   SELECT v_kq AS ketqua;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `p_update_nhanvien` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_update_nhanvien` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_update_nhanvien`(
        p_img_canbo LONGTEXT,
        p_id_canbo VARCHAR(500),
	p_hoten_canbo VARCHAR(500),
	p_donvi_canbo VARCHAR(100),
	p_linhvuc_canbo VARCHAR(100),
	p_ngaysinh_canbo VARCHAR(1024),
	p_id_ct_quay VARCHAR(500),
	p_tt_canbo VARCHAR(100),
	p_donvi_quanli VARCHAR(100)
	
)
BEGIN
	DECLARE v_kq INT(100);	
	
	IF (p_img_canbo = '') THEN
		UPDATE can_bo
		SET	hoten_canbo = p_hoten_canbo,
			donvi_canbo = p_donvi_canbo,
			ngaysinh_canbo = p_ngaysinh_canbo,
			id_ct_quay = p_id_ct_quay,
			tt_canbo = p_tt_canbo,
			linhvuc_canbo = p_linhvuc_canbo
		WHERE id_canbo = p_id_canbo
		AND donvi_quanli=p_donvi_quanli;
	        SELECT ROW_COUNT() INTO v_kq;
	ELSE
		UPDATE can_bo
		SET	hoten_canbo = p_hoten_canbo,
			donvi_canbo = p_donvi_canbo,
			ngaysinh_canbo = p_ngaysinh_canbo,
			id_ct_quay = p_id_ct_quay,
			tt_canbo = p_tt_canbo,
			linhvuc_canbo = p_linhvuc_canbo,
			img_canbo =p_img_canbo
		  WHERE id_canbo = p_id_canbo
		  AND donvi_quanli=p_donvi_quanli;
		 SELECT ROW_COUNT() INTO v_kq;
	END IF;
	
	SELECT v_kq AS ketqua;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `p_xoa_nhanvien` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_xoa_nhanvien` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_xoa_nhanvien`(
	p_id_canbo VARCHAR(500),
	p_madonvi VARCHAR(100)
)
BEGIN
	DECLARE v_kq INT(11);
	DECLARE v_kt_danhgia INT(11);
	
	SELECT COUNT(*) INTO v_kt_danhgia FROM danh_gia WHERE donvi_quanli = p_madonvi AND id_canbo=p_id_canbo;
	
	
	IF (v_kt_danhgia > 0) THEN
		SET v_kq = '-1';
	ELSE
		update can_bo set da_xoa=1,thoigian_xoa=DATE_FORMAT(NOW(),'%Y-%m-%d %H:%i:%s')
		 WHERE donvi_quanli = p_madonvi AND id_canbo=p_id_canbo;	
		
		SELECT ROW_COUNT() INTO v_kq;
	END IF;
	
	SELECT v_kq AS ketqua;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `update_cauhinh` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_cauhinh` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_cauhinh`(IN _key VARCHAR(11),IN _value VARCHAR(2048),IN _ban VARCHAR(3), OUT effected_rows INT(11))
BEGIN
	update cau_hinh set `value` = _value,`ban` = _ban where `key`=_key;
	SET effected_rows = ROW_COUNT();
	SELECT effected_rows;
END */$$
DELIMITER ;

