/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_tiepnhanW2LED`(IN _id int(11), IN _trang_thai_led int(1), OUT effected_rows INT(11))
BEGIN
	update tiepnhan set trang_thai_led = _trang_thai_led where id=_id;
